import React, { useState, useEffect } from 'react';

const TrackerBarca = () => {
  const [barca, setBarca] = useState({
    nome: "Titanic",
    latitudine: 50.9039,
    longitudine: -1.4043
  });

  const [posizioni, setPosizioni] = useState([]);

  useEffect(() => {
    const velocità = 0.0005;
    const direzione = Math.PI / 4;

    const timer = setInterval(() => {
      setBarca(prev => {
        const nuovaLat = prev.latitudine + velocità * Math.cos(direzione);
        const nuovaLng = prev.longitudine + velocità * Math.sin(direzione);
        const ora = new Date();

        setPosizioni(p => [
          ...p,
          { lat: nuovaLat, lng: nuovaLng, tempo: ora.toLocaleTimeString() }
        ]);

        return { ...prev, latitudine: nuovaLat, longitudine: nuovaLng };
      });
    }, 3000);

    return () => clearInterval(timer);
  }, []);

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #f5f5f7 0%, #e0e0e5 100%)',
      fontFamily: '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif',
      padding: '20px'
    }}>

      <div style={{
        background: 'rgba(255, 255, 255, 0.6)',
        backdropFilter: 'blur(20px)',
        borderRadius: '20px',
        padding: '25px',
        marginBottom: '25px',
        border: '1px solid rgba(200, 200, 200, 0.3)',
        boxShadow: '0 10px 25px rgba(0, 0, 0, 0.05)'
      }}>
        <h1 style={{
          fontSize: '28px',
          fontWeight: '600',
          color: '#1d1d1f',
          margin: '0',
          textAlign: 'center'
        }}>
          🚢 Tracker Titanic
        </h1>
      </div>

      <div style={{
        background: '#ffffffcc',
        backdropFilter: 'blur(20px)',
        borderRadius: '20px',
        padding: '30px',
        marginBottom: '25px',
        border: '1px solid rgba(200, 200, 200, 0.3)',
        boxShadow: '0 10px 25px rgba(0, 0, 0, 0.05)'
      }}>
        <h2 style={{
          fontSize: '22px',
          fontWeight: '500',
          color: '#1d1d1f',
          marginBottom: '20px'
        }}>
          Posizione Live
        </h2>

        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '20px' }}>
          <InfoCard label="Nome" value={barca.nome} color="#007aff" />
          <InfoCard label="Latitudine" value={barca.latitudine.toFixed(6)} color="#34c759" />
          <InfoCard label="Longitudine" value={barca.longitudine.toFixed(6)} color="#ff9500" />
        </div>
      </div>

      <div style={{
        background: '#ffffffcc',
        backdropFilter: 'blur(20px)',
        borderRadius: '20px',
        padding: '30px',
        marginBottom: '25px',
        border: '1px solid rgba(200, 200, 200, 0.3)',
        boxShadow: '0 10px 25px rgba(0, 0, 0, 0.05)'
      }}>
        <h3 style={{
          fontSize: '20px',
          fontWeight: '500',
          color: '#1d1d1f',
          marginBottom: '20px'
        }}>
          Statistiche di Viaggio
        </h3>

        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '15px' }}>
          <StatsCard value={posizioni.length} label="Punti Tracciati" color="#af52de" />
          <StatsCard value={posizioni[0]?.tempo || "--:--"} label="Primo Punto" color="#5ac8fa" />
          <StatsCard value={posizioni.at(-1)?.tempo || "--:--"} label="Ultimo Punto" color="#ff3b30" />
        </div>
      </div>

      <div style={{
        background: '#ffffffcc',
        backdropFilter: 'blur(20px)',
        borderRadius: '20px',
        padding: '30px',
        border: '1px solid rgba(200, 200, 200, 0.3)',
        boxShadow: '0 10px 25px rgba(0, 0, 0, 0.05)'
      }}>
        <h3 style={{
          fontSize: '20px',
          fontWeight: '500',
          color: '#1d1d1f',
          marginBottom: '20px'
        }}>
          Storico Recente
        </h3>

        <div style={{ maxHeight: '300px', overflowY: 'auto' }}>
          {posizioni.slice(-10).reverse().map((pos, index) => (
            <div key={index} style={{
              background: index % 2 === 0 ? '#f2f2f7' : 'transparent',
              padding: '12px 20px',
              borderRadius: '12px',
              marginBottom: '8px',
              display: 'grid',
              gridTemplateColumns: '1fr 2fr 2fr',
              gap: '20px',
              alignItems: 'center'
            }}>
              <div style={{ fontWeight: '500', color: '#007aff', fontSize: '14px' }}>{pos.tempo}</div>
              <div style={{ color: '#1d1d1f', fontSize: '14px', fontFamily: 'SF Mono, monospace' }}>
                {pos.lat.toFixed(6)}
              </div>
              <div style={{ color: '#1d1d1f', fontSize: '14px', fontFamily: 'SF Mono, monospace' }}>
                {pos.lng.toFixed(6)}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

const InfoCard = ({ label, value, color }) => (
  <div style={{
    background: '#f9f9f9',
    borderRadius: '12px',
    padding: '20px',
    textAlign: 'center',
    border: `1px solid ${color}22`
  }}>
    <div style={{ fontSize: '13px', color: '#8e8e93', marginBottom: '4px' }}>{label}</div>
    <div style={{ fontSize: '17px', fontWeight: '600', color }}>{value}</div>
  </div>
);

const StatsCard = ({ value, label, color }) => (
  <div style={{
    background: color + '22',
    borderRadius: '12px',
    padding: '20px',
    textAlign: 'center',
    color: color
  }}>
    <div style={{ fontSize: '24px', fontWeight: '700' }}>{value}</div>
    <div style={{ fontSize: '13px', opacity: 0.8 }}>{label}</div>
  </div>
);

export default TrackerBarca;
